column77:
The University of West London (UWL) has placed a Contract Notice in Contracts Finder and invites you to participate in a tender for the provision of a Resource List Management System. 

 

As a minimum UWL require the following functionality: 

 

The system to integrate with Koha Library Management System and Blackboard VLE; 

The system must allow the creation of hierarchical lists of resources using a bookmarking tool or by manually adding items; 

The system must provide robust usage statistics which are downloadable in a common format.
